import logo from './logo.svg';
import './App.css';
import React from "react";
import axios from "axios";

class App extends React.Component{

  constructor(props) {
    super(props);
    this.state = {apiResponse: ""};
  }

  callTimeAPI() {
    const data = {
      _username: 'radumitriu',
      _password: 'suntsmecher'
    }
    axios
        .post(`http://localhost:7080/login`, data)
        .then(resp => {
          this.setState({timeApiResponse: resp.text()});
        })
        .catch(err => {
          this.setState({timeApiResponse:'Nu merge'});
        })
  }

  render() {
    return (
        <div>
          <button onClick={this.callTimeAPI}>
            Testare
          </button>
          {this.state.apiResponse}
        </div>
    );
  }
}

export default App;
